@import url("https://fonts.googleapis.com/css?family=Montserrat");
html {
  width: 100vw;
  height: 100vh;
  margin: 0px; }

body {
  font-family: "Montserrat", sans-serif; }

.container {
  display: grid;
  grid-template-columns: repeat(12, 1fr);
  grid-template-rows: minmax(100px, auto); }
  .container header {
    grid-column: 1/13;
    grid-row: 1/2;
    background-image: url("312259f98a28fa37603327051c1f3c9c.png");
    background-size: contain;
    background-repeat: no-repeat; }
    .container header h1 {
      grid-column: 4/8;
      font-size: 2.7em; }
  .container main {
    grid-column: 1/13;
    grid-row: 2/2; }
